import React  from 'react';

import {useHistory} from "react-router-dom";

const LoggedUser = () => {


  const history = useHistory();
  const Logout =() =>{
    history.push("/")
  }

  return (
    <div>
      <h1>Hello</h1>
      <button onClick={Logout}>Logout</button>
    </div>
  )
}

export default LoggedUser
